class Solution(object):
    def countSubIslands(self, grid1, grid2):
        """
        :type grid1: List[List[int]]
        :type grid2: List[List[int]]
        :rtype: int
        """
        M = len(grid1)
        N = len(grid1[0])
        DIRECTIONS = ((-1, 0), (1, 0), (0, 1), (0, -1))

        def doSubIslands(x, y):
            from collections import deque
            bfs = deque()
            bfs.append((x, y))
            grid2[x][y] = 0
            ans = (grid1[x][y] == 1)
            while bfs:
                x, y = bfs.popleft()
                for direction in DIRECTIONS:
                    nx = x + direction[0]
                    ny = y + direction[1]
                    if 0 <= nx < M and 0 <= ny < N:
                        if grid2[nx][ny] == 1:
                            bfs.append((nx, ny))
                            grid2[nx][ny] = 0
                            if grid1[nx][ny] == 0:
                                ans = False
            return ans

        ans = 0
        for x in range(M):
            for y in range(N):
                if grid2[x][y] == 1:
                    if doSubIslands(x, y):
                        ans += 1
        return ans


